import React from "react";
import styled from "styled-components";
import ImgSlider from "../../mainslider/ImgSlider";
export default function Contact() {
  return (
    <div>
      <ContactContainer>
        <ImgSlider />
      </ContactContainer>
    </div>
  );
}

const ContactContainer = styled.div`
  border: 2px solid greenyellow;
  position: relative;
  top: 60%;
  text-align: center;
`;
